; =============== S U B	R O U T	I N E =======================================


SCI_INT_HNDLR:				; ...
		ldd	SCSR		; status & data	registers
		brset	SCI_STATUS_21 $40 Rx_C9AE ; '@' ;  STAT_21?
		brclr	SCI_STATUS_21 $20 RX_1st_Byte ;	' ' ; first RxByte? disable Tx
		jmp	Tx_CA41		; jump to Tx routine
; ---------------------------------------------------------------------------

RX_1st_Byte:				; ...
		bset	SCI_STATUS_21 $C0 ; '' ; first RxByte? disable Tx
		ldx	#$102D		; pointer to SCCR2:SCDAT
		bclr	0,x 8		; disable TX

Rx_C9AE:				; ...
		bita	#$20 ; ' '      ; test for Rxdata received
		beq	reset_SCI_Comms	; bra if no Rx data
		bita	#$A		; test	for error flags
		bne	reset_SCI_Comms	; bra if TxPending or RxData received
		tba			; RxData to A
;note: SCI_1A0 is defined as a word so 1A1 is shown as 1A0+1
		addb	SCI_1A0+1	; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		stab	SCI_1A0+1	; data count?
		ldab	SCI_1A0		; SDL msg buffer addr pointer?
		ldx	#$195		; SDL message buffer
		abx			; add the data count?
		cpx	#$1A0		; X - msg buffer top
		bcc	reset_SCI_Comms	; bra if buffer	full
		staa	0,x		; RxData to SDL	msg buffer
		incb
		stab	SCI_1A0		; inc msg buffer pointer
		cmpb	SCI_DATA_BUF	; SDL Message byte count
		beq	parse_OBD_HDR	; bra if end of	message
		cmpb	#3
		bcs	set_SCI_Timeout	; set message timeout
		ldaa	SCI_HDR		; SDL message header

OBD_HDR13:				; A=HDR
		cmpa	#$13
		bne	set_SCI_Timeout
		ldy	#$197
		subb	#3
		aby
		ldab	0,x		; get diagnostic address
		aslb			; multiply by two to get table offset
		ldx	#$C94D		; OBD_ADDR_LUT
		abx
		ldx	0,x		; X= OBD ADDR
		ldaa	0,x		; get data
		staa	0,y		; store	in buffer

set_SCI_Timeout:			; ...
		ldaa	#$2E ; '.'
		staa	SCI_CNT_1A3	; 46*64.5ms = 3sec timeout
		rts
; ---------------------------------------------------------------------------

parse_OBD_HDR:				; ...
		ldaa	SCI_1A0+1	; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		bne	reset_SCI_Comms	; checksum must	add to zero
		ldaa	SCI_HDR		; SDL message header
		ldx	#$C941		; OBD Hdr Jump table
					;
		ldab	#3

loc_CA08:				; ...
		cmpa	0,x
		beq	Tx_CA24		; x is a pointer to OBD_HDR_JMP_LUT
		abx
		cpx	#$C94D		; OBD Addr LUT
		bcs	loc_CA08

reset_SCI_Comms:			; ...
		clra
		clrb
		std	SCI_STATUS_21	; clr sci_status_21
		std	SCI_1A0		; clear	rx buffer address pointer
		staa	STATUS_23	; clear	status_23
		ldd	SCSR		; read to clear	error flags?
		ldaa	#$26 ; '&'
		staa	SCCR2		; enable Tx,Rx and Rx interrupt
		rts
; ---------------------------------------------------------------------------

Tx_CA24:				; ...
		ldx	1,x		; x is a pointer to OBD_HDR_JMP_LUT
		jsr	0,x		; call sub OBD_HDR_10
		ldaa	#$88 ; ''      ; enable Tx and Tx interrupt
		staa	SCCR2		; SCCR2	SCI Control Register 2
		bclr	SCI_STATUS_21 $40 ; '@'
		bset	SCI_STATUS_21 $20 ; ' '
		ldaa	SCI_HDR		; SDL message header
		staa	SCDAT		; send SDL header
		staa	SCI_1A0+1	; 1A1 =	csum?
		clra
		staa	SCI_1A0		; reset	rx buffer address pointer
		rts
; ---------------------------------------------------------------------------

Tx_CA41:				; ...
		bita	#$80 ; ''      ; test for tx empty
		beq	reset_SCI_Comms	; bra if tx still pending
		ldaa	SCI_DATA_BUF	; get data from	buffer
		ldab	SCI_1A0		; b = TxDataCount
		bne	do_Tx_CSum
		incb
		stab	SCI_1A0		; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		staa	SCDAT		; SCDAT	SCI Data (Read RDR, Write TDR)
		adda	SCI_1A0+1	; checksum?
		staa	SCI_1A0+1	; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		rts
; ---------------------------------------------------------------------------

do_Tx_CSum:				; ...
		incb
		stab	SCI_1A0		; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		deca
		cba
		bhi	Tx_CA6D		; SCI_DATA_BUFF+1
		bcs	RST_SCI
		ldaa	SCI_1A0+1	; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		nega
		staa	SCDAT		; SCDAT	SCI Data (Read RDR, Write TDR)
		rts
; ---------------------------------------------------------------------------

Tx_CA6D:				; ...
		ldx	#$197		; SCI_DATA_BUFF+1
		subb	#2
		abx
		ldaa	0,x
		staa	SCDAT		; SCDAT	SCI Data (Read RDR, Write TDR)
		adda	SCI_1A0+1	; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		staa	SCI_1A0+1	; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		rts
; ---------------------------------------------------------------------------

RST_SCI:				; ...
		ldaa	#$26 ; '&'
		staa	SCCR2		; set RIE, RE, RWU
		bclr	SCI_STATUS_21 $20 ; ' '
		clra
		clrb
		std	SCI_1A0		; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		rts
; End of function SCI_INT_HNDLR


