		std	WTS_CNT_140	; clear	word_140,1
		std	FCodes3		; clear	Fcodes3,2
		std	FCodes1		; clear	FCodes1,0
		ldaa	#4		; 4 byte return	message?

;return	a '1' until SCI_CNT_1A2 times out

		ldab	SCI_CNT_1A2	; serial port timeout each tick	= 64.5ms
		beq	loc_CAAF	; bra if tmr=0;
