OBD_HDR_15:
		ldd	SCI_BUFF_4
		beq	loc_CAC7	; bra if lower order commands
		tsta			; higher order sub-set 1?
		beq	loc_CAC7
		ldaa	#2
		tstb
		beq	loc_CAC7
		oraa	#1

loc_CAC7:				; ...
		ldab	STATUS_23
		andb	#$FC ; ''      ; test for current EGR control
		aba
		staa	STATUS_23	; 03 if	EGR control
		ldaa	#3
		staa	SCI_DATA_BUF	; SDL data buffer
		ldd	SCI_DATA_BUF+1	; SDL data buffer
		staa	Ctrls_Status_22	; 22 = 10 if fixed advance
					;      80 if IAC cal
		cmpb	#$E6 ; ''      ; Maximum idle = 1797
		bcs	loc_CADE	; minimum idle = 500
		ldab	#$E6 ; ''

loc_CADE:				; ...
		cmpb	#$40 ; '@'      ; minimum idle = 500
		bcc	loc_CAE4	; subtract 51
		ldab	#$40 ; '@'

loc_CAE4:				; ...
		subb	#$33 ; '3'      ; subtract 51
		ldaa	#5		; multiply by 5
		mul
		lsrd			; divide word by 2
		lsrd			; divide word by 2
		stab	Control_T_Idle	; target idle 2
		rts
; End of function OBD_HDR_15

;Update_SCI_TMRS:
;Called	on a 65.5ms tick
;These	are the	timeout	counters for the serial	comms

; =============== S U B	R O U T	I N E =======================================


SCI_TMR_TICK:				; ...
		clrb
		ldaa	SCI_CNT_1A2	; serial port timeout each tick	= 64.5ms
		beq	loc_CAF9
		deca
		staa	SCI_CNT_1A2	; decrement tick

loc_CAF9:				; ...
		ldaa	SCI_CNT_1A3	; serial port timeout each tick	= 64.5ms
		beq	locret_CB15
		deca
		staa	SCI_CNT_1A3	; decrement tick
		bne	update_DIAG_VALUES ; bra if O2S	inactive
		sei
		std	SCI_STATUS_21
		std	SCI_1A0		; 1A0 =	rx buffer address pointer
					; 1A1 =	checksum
		staa	STATUS_23
		ldd	SCSR		; SCSR SCI Status Register
		ldaa	#$26 ; '&'
		staa	SCCR2		; SCCR2	SCI Control Register 2
		cli

locret_CB15:				; ...
		rts
