		addd	temp_192
		addd	temp_192
		lsrd			; then divide by 16
		lsrd
		lsrd
		lsrd
		std	VExMAP		; VE value after multiply by MAP
		ldab	MAP_BA		; related to MAP
		ldx	#4		; x = 4
		abx			; x = 4	+ MAP_BA
; calculate fuel trim corrections
		ldd	new_LTFT_14	; get the latest calculated LTFT
		lsrd			; /16
		lsrd
		lsrd
		lsrd
; calculate weighted LTFT average
		addb	0,x		; b = MAP value	+ (new_LTFT/16)
		rorb			; /2
		addb	LTFT
		adca	#0		; add carry to high byte
		addb	LTFT
		adca	#0		; add carry to high byte
		addb	LTFT
		adca	#0		; add carry to high byte
		lsrd
