; CALC_IGN_DWELL
; calculates the ignition coil dwell time from a
; 3D table look	up, RPM	v Batt Volts

; =============== S U B	R O U T	I N E =======================================


CALC_IGN_DWELL:				; ...
		ldx	#$C775
		ldd	RPMdiv50	; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		suba	#$10		; A= RPM-800RPM
		bcc	loc_DB20	; bra if RPM>800
		clra			; RPM=0	if below 800rpm
		clrb

loc_DB20:				; ...
		cmpa	#$80 ; ''      ; (RPM-800) - 6400
		bcs	loc_DB29	; bra if RPM<7200
		ldd	#$800		; else limit to	7200rpm
		bra	loc_DB2D	; save scaled RPM value	for 3D lookup
; ---------------------------------------------------------------------------

loc_DB29:				; ...
		lsrd			; apply	scaling	for table lookup
		lsrd
		lsrd
		lsrd

loc_DB2D:				; ...
		std	word_18C	; save scaled RPM value	for 3D lookup

; calculate Batt voltage scaling

		ldaa	BATTV
		suba	#$73 ; 's'      ; A = BattV-9V
		bcc	loc_DB37	; bra if battV>9V
		clra			; else set A to	0

loc_DB37:				; ...
		cmpa	#$60 ; '`'      ; (battV-9V)-7.5V
		bcs	loc_DB3D	; bra i9f battV	> 16.5V
		ldaa	#$60 ; '`'      ;  else limit to 16.5V

loc_DB3D:				; ...
		ldab	#8
		mul			; apply	scaling	for table look up
		stab	byte_18E	; save scaled batt voltage for table look up
		ldab	#9
		jsr	TAB_LU_3D	; do the 3d table lookup
		lsrd			; scale	result (/8)
		lsrd
		lsrd
		std	IGN_DWELL	; job done
		rts
; End of function CALC_IGN_DWELL


; =============== S U B	R O U T	I N E =======================================


SUM_IGN_ADV:				; ...
		clra
		ldab	IGN_BASE_ADV	; get PARAM1 - base timing?
		addb	IGN_WTS_CORR	; add PARAM2 = WTS advance
		adca	#0		; add carry to high byte
		subb	IGN_IAT_CORR	; subtract PARAM3 - IAT	retard
		sbca	#0
		addd	IGN_SUM1_ADV	; add previous value
		lsrd			; and average
		std	IGN_SUM1_ADV	; store	new value
		addb	IGN_IDLE_CORR	; add correction for delta RPM
		adca	#0		; add carry to high byte
		addb	IGN_PSP_KICK	; add tip in advance?
		adca	#0		; add carry to high byte
		addb	IGN_ELOAD_KICK1? ; add electrical load correction?
		adca	#0		; add carry to high byte
		subb	IGN_v_WTS_IGN8	; subtract CTS correction at idle?
		sbca	#0		; subtract borrow from high byte
		subb	IGN_IAT_CORR?	; this is related to VSS and idle
		sbca	#0		; subtract borrow from high byte
		subb	RFAN_IGN_COR	; high temp correction?	(rad fan on)
		sbca	#0		; subtract borrow from high byte
		subd	#$100		; subtract 256
		bcs	loc_DB8B	; = Eh
		tsta
		bne	testMaxAdv	; = 52.7 degrees ??
		cmpb	byte_C924	; = B8h
		bcs	testMinAdv	; = Eh

testMaxAdv:				; ...
		ldab	byte_C924	; = 52.7 degrees ??

testMinAdv:				; ...
		cmpb	byte_C925	; = Eh
		bcc	loc_DB8E	;  = -10.3 degrees???

loc_DB8B:				; ...
		ldab	byte_C925	; = Eh

loc_DB8E:				; ...
		stab	IGN_IN_DEGS	;  = -10.3 degrees???
		rts
; End of function SUM_IGN_ADV


