; calc_TIME_TO_DWELL
; time to dwell	is scheduled from the CAS pin going high


; =============== S U B	R O U T	I N E =======================================


do_TIME_TO_DWELL:			; ...
		ldd	CPS_CNT_MOD	; could	this be	the start of the dwell period?
		addd	IGN_DWELL	; add the dwell
		coma
		negb			; invert
		sbca	#$FF
		subd	#$C8 ; ''      ; and subtract?
		sei			; disable interrupts
		clr	byte_E5		; clear	byte_E5
		addd	CPS_CNT_div16	; add another CPS_COUNT
		bcs	loc_DC22	; bra if overflow
		inc	byte_E5		; increment E5
		addd	byte_CC		; add CC
		bcs	loc_DC22	; bra if overflow
		inc	byte_E5		; increment E5 again
		addd	CPS_COUNT_2	; add another CPS count
		bcs	loc_DC22	; bra if overflow
		inc	byte_E5		; increment E5 again
		addd	byte_CC		; add CC again
		bcs	loc_DC22	; bra if overflow
		clra			; clear	D
		clrb

loc_DC22:				; ...
		addd	#$C8 ; ''      ; add 400us
		std	TIME_TO_DWELL	; and save
		cli			; enable interrupts
		rts
; End of function do_TIME_TO_DWELL

