do_IGN:
Ignition output	is tested until	two readings are the same
then tested for	coil on	or off

; =============== S U B	R O U T	I N E =======================================


do_IGN:					; ...
		ldab	PORTA		; get PORTA
		pshb
		ldaa	TFLG1		; TFLG1	Main Timer Interrupt Flag Register 1
		eorb	PORTA		; EOR with PORTA
		bitb	#$80 ; ''      ; test IGN output
		pulb
		bne	do_IGN
		bita	#$80 ; ''      ; test OC1IF
		beq	loc_DC61
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		bita	#$80 ; ''
		bne	do_IGN_2

loc_DC61:				; ...
		bitb	#$80 ; ''
		beq	loc_DC72
		ldaa	IGN_CNT_EA
		bra	loc_DCBF
; End of function do_IGN

do_IGN_2
IGN output, 0=on, 1=off

; =============== S U B	R O U T	I N E =======================================


do_IGN_2:				; ...
		bitb	#$80 ; ''      ; test ignition pin
		bne	COIL_ON_DCB6	; bra if coil on
		ldd	TOC1H		; TOC1H	Output Compare 1 Register H
		std	TOC1H_T1

loc_DC72:				; ...
		ldaa	IGN_CNT_EA
		cmpa	byte_E2
		beq	loc_DC8A	; get ign dwell	time
		bcs	SCH_IGN_SPARK	; get OC edge setting

loc_DC7A:				; ...
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		anda	#$7F ; ''
		staa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1

locret_DC82:				; ...
		rts
; ---------------------------------------------------------------------------

SCH_IGN_SPARK:				; ...
		ldaa	OC1D		; get OC edge setting
		bita	#$80 ; ''      ; test IGN polarity
		bne	locret_DC82

loc_DC8A:				; ...
		ldd	IGN_DWELL	; get ign dwell	time
		lsrd			; divide by 2
		addd	TOC1H_T1
		pshb
		psha
		subd	CPS_CNT_E3?
		subd	CPS_TIME
		pula
		pulb
		bpl	loc_DC9D
		ldd	CPS_CNT_E3?
		addd	CPS_TIME

loc_DC9D:				; ...
		std	TOC1H		; TOC1H	Output Compare 1 Register H
		ldaa	OC1D		; get OC edge setting
		oraa	#$80 ; ''
		staa	OC1D		; 1 = coil off next OC match
		ldaa	#$80 ; ''
		staa	TFLG1		; TFLG1	Main Timer Interrupt Flag Register 1
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		oraa	#$80 ; ''
		staa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		rts
; ---------------------------------------------------------------------------

COIL_ON_DCB6:				; ...
		ldaa	#2
		brclr	STATUS_26 1 loc_DCBD
		inca

loc_DCBD:				; ...
		staa	IGN_CNT_EA

loc_DCBF:				; ...
		cmpa	byte_E5
		bhi	loc_DC7A
		beq	loc_DCCD
		ldaa	OC1D		; get OC edge setting
		bita	#$80 ; ''      ; test IGN bit
		bne	loc_DCE4	; bra if not zero
		rts
; ---------------------------------------------------------------------------

loc_DCCD:				; ...
		ldd	TIME_TO_DWELL	; related to dwell time
		cpd	#$9C4
		bcs	SCH_IGN_DWELL	; D = CPS_TIME + byte_E6
; End of function do_IGN_2


; =============== S U B	R O U T	I N E =======================================


SCHEDULE_IGN_1:				; ...
		addd	CPS_TIME	; D = CPS_TIME + byte_E6
		bra	loc_DD00	; save as next ign event
; ---------------------------------------------------------------------------

SCH_IGN_DWELL:				; ...
		addd	CPS_TIME	; D = CPS_TIME + byte_E6
		subd	TOC1H		; D - last ign event time
		cpd	#$1F4		; D - 1ms
		bcc	loc_DCE7	; bra if D>1ms

loc_DCE4:				; ...
		ldd	#$1F4		; else min time	= 1ms

loc_DCE7:				; ...
		addd	TOC1H		; D is CPS_TIME	or TOC1H + 1ms ???
		pshb
		psha			; save D to stack
		subd	TCNT1H		; D - current time
		cpd	#$F		; have we got time to schedule the next	event?
		bge	loc_DCFE	; yes, branch
		ldd	#$F
		addd	TCNT1H		; else D=15 (immediate trigger)
		pulx			; restore stack	(throwaway x)
		bra	loc_DD00	; bra
; ---------------------------------------------------------------------------

loc_DCFE:				; ...
		pula			; restore D
		pulb

loc_DD00:				; ...
		std	TOC1H		; save as next ign event
		ldaa	OC1D		; get OC edge setting
		anda	#$7F ; ''
		staa	OC1D		; 0 = coil on next OC match
		ldaa	#$80 ; ''
		staa	TFLG1		; clear	ign event interrupt flag
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		oraa	#$80 ; ''
		staa	TMSK1		; enable ign event interrupt
		rts
; End of function SCHEDULE_IGN_1

