; testPortG
; PORTG_SH_H is	a copy of PORTG
; PortG_SH_L starts as a copy of PORTG and is then used	to indicate any	changes

; =============== S U B	R O U T	I N E =======================================


testPortG:				; ...
		ldaa	PORTG		; fetch	PORTG
		psha			; save to stack
		eora	PORTG_SH_L	; any bits that	were changed last time are now reset
		tab			; copy to B
		anda	PORTG_SH_H	; and last PORTG
		comb			; invert B
		andb	PORTG_SH_L	; low byte of double
		aba			; AS=A+B
		pulb			; B = PORTG
		std	PORTG_SH_H	; B is a copy of PORTG
		rts
; End of function testPortG


