; execute if idle switch has just gone active

		bclr	STATUS_27 $10	; clear	idle switch active
		ldd	TPSV_8_2ms	; updated on an	8.2ms tick
		std	ISC_Target_Pos
		jsr	clear_ISC_F9
		jsr	Do_fixed_INJ_PW?

idleSwOn_EC77:				; ...
		ldaa	byte_C84D	; related to TPS_CNT_14C
		staa	CNT_TIDLE_F1
		ldab	byte_C7D9	; related to TIDLE

loc_EC7F:				; ...
		stab	CNT_TIDLE_F0
		clra
		staa	count_F2	; clear	F2
		rts
; ---------------------------------------------------------------------------

DEC_CNT_F0:				; ...
		ldab	CNT_TIDLE_F0
		beq	do_TIDLE_ERR	; bra if idle switch ON
		decb
		bra	loc_EC7F
; ---------------------------------------------------------------------------

do_TIDLE_ERR:				; ...
		brset	STATUS_27 $10 loc_ECA8 ; bra if	idle switch ON
		bset	STATUS_27 $10	; set idle switch ON
		ldd	TPSV_8_2ms	; updated on an	8.2ms tick
		std	ISC_Target_Pos

; calculate the	difference between actual RPM and Target idle RPM
; (TIDLE_RPM)/8	+ 8 = RPM/50

		ldab	TIDLE_RPM	; get Target Idle RPM
		lsrb			; divide by 8
		lsrb
		lsrb
		addb	#8		; and add 8?
		ldaa	RPMdiv50	; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		sba			; RPM -	target
		bcc	loc_ECA5	; bra if RPM > target
		clra			; else set TIDLE_ERROR to 0

loc_ECA5:				; ...
		staa	TargetIdleError	; 0 if RPM>Tidle else a	negative value

loc_ECA8:				; ...
		clra
		staa	count_F3
		ldaa	CNT_TIDLE_F1
		beq	locret_ECB2
		deca
		staa	CNT_TIDLE_F1

locret_ECB2:				; ...
		rts
; End of function not_idle_EC62


