; CALC_RPM:
; fdiv places a	16-bit numerator in D and a 16-bit denominator in X
; fdiv is equivalent to	numerator*2^16/denominator
; the quotient is placed in X and the remainder	in D
; Note:50G11 is	a 3-cylinder ECU so CPS	pulses are 240 degrees apart.
; CPS_COUNT rolls over at 302rpm.

; =============== S U B	R O U T	I N E =======================================


CALC_RPM:				; ...
		ldd	#$61B		; D=1563
; calculate RPM, save the previous value as RPMH_T1

		ldx	CPS_COUNT	; X=CPS_COUNT
		fdiv			; D/X -	fractional divide
		ldd	RPMdiv50	; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		std	RPMH_T1		; save as last RPMH
		stx	RPMdiv50	; RPMH=RPM*5
;
; calculate deltaRPM averaged over two CPS events
		xgdx
		subd	RPMH_T1		; new RPMH - last RPMH
		addd	dRPM		; add dRPM
		asra			; and divide by	two
		rorb
		std	dRPM		; and store
; RPM_AV_97:
; This is a weighted average of	RPM used in the	ISC calculations.

CALC_RPM_AV_97:				; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		ldd	RPMdiv50
		brset	STATUS_27 $20 loc_F01F ; ' ' ; bra if rpm<500
		subd	RPM_AV_97	; Weighted average of RPM used for ignition idle correction
					; x = RPM/50
		cpd	#$20 ; ' '
		bge	loc_F013	; RPMdiv50 / 32
		cpd	#$FFE0
		ble	loc_F013	; RPMdiv50 / 32
		ldd	RPMdiv50	; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		bra	loc_F01F	; store	the new	average	value
; ---------------------------------------------------------------------------

loc_F013:				; ...
		asra			; RPMdiv50 / 32
		rorb
		asra			; shift	A right, b7=>b7, b0=>carry
		rorb			; shift	B right, carry=>b7, b0=>carry
		asra
		rorb
		asra
		rorb
		asra
		rorb
		addd	RPM_AV_97	; add the previous value

loc_F01F:				; ...
		std	RPM_AV_97	; store	the new	average	value
;
; RPM_AV_99:
; This is a weighted average used to test against the Target Idle
; speed.
; RPM =	6.25x +	400 (max. 2000rpm)

CALC_RPM_AV_99:				; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		ldd	RPMdiv50

rescale	RPMdiv50

		cmpa	#$28 ; '('      ; RPM-2000rpm
		bcs	loc_F02C	; bra if RPM<2000
		ldd	#$FFFF		; else limit RPM to 2000
		bra	loc_F037
; ---------------------------------------------------------------------------

loc_F02C:				; ...
		suba	#8		; RPMH-400
		bcc	loc_F034	; bra if RPM>409
		clra			; if RPM<409 D=0000h
		clrb
		bra	loc_F037
; ---------------------------------------------------------------------------

loc_F034:				; ...
		lsld
		lsld
		lsld

loc_F037:				; ...
		subd	RPM_AV_99	; subtract the previous	RPM_AV_99
		rora			; divide by 4
		rorb
		asra
		rorb
		addd	RPM_AV_99	; add the previous value
		std	RPM_AV_99	; and store as the new value
		rts
; End of function CALC_RPM


