do_CONFIG:
CONFIG_4B is from a potential divider that sets	the ECU	config,
for the	50G11 the output is always 5V (no lower	resistor)
called from INIT and on	the 1 second tick.

do_Config:				; ...
		ldab	#1		; set up table pointer
		ldx	#$F219		; load start of	voltage	table
		ldaa	CONFIG_4B

loc_F228:				; ...
		cmpa	0,x		; ADC volts - table value
		bcc	set_AT_F239	; bra if ADC volts > table volts
		incb			; increment table pointer
		inx			; increment x
		cpx	#$F220		; end of table
		bls	loc_F228	; loop back if ADC volts < table volts
		cmpb	#9		; test for end of table
		bls	set_AT_F239	; bra if pointer = 9
		ldab	#1		; default = 1 (V < last	value)

set_AT_F239:				; ...
		ldaa	CONFIG_3A	; get byte_3A
		anda	#$80 ; ''      ; mask off auto bit
		aba			; add A
		staa	CONFIG_3A	; and update

determine the values of	16E and	16F based on the ECU config:
only the auto/manual bit makes a difference, all the tables are	zeroed (80h)

		anda	#$F		; mask off upper bits
		ldx	#$C80F
		brclr	CONFIG_3A $80 MT_F259 ;	'' ; bra if manual trans

AT_F249:
		cmpa	#4
		bcs	store_16E_16F
		ldx	#$C811
		cmpa	#7
		bcs	store_16E_16F
		ldx	#$C813
		bra	store_16E_16F
; ---------------------------------------------------------------------------

MT_F259:				; ...
		cmpa	#1
		beq	store_16E_16F
		cmpa	#4
		beq	store_16E_16F
		cmpa	#7
		beq	store_16E_16F
		ldx	#$C815
		cmpa	#2
		beq	store_16E_16F
		cmpa	#5
		beq	store_16E_16F
		cmpa	#8
		beq	store_16E_16F
		ldx	#$C817

store_16E_16F:				; ...
		ldd	0,x
		staa	byte_16E
		stab	byte_16F
		rts
; ---------------------------------------------------------------------------
		fcb   0
		fcb   6
		fcb   0
		fcb  $E
		fcb   0
		fcb $1E
		fcb   0
		fcb $3E	; >
		fcb   0
		fcb   5
		fcb   0
		fcb  $D
		fcb   0
		fcb $1D
		fcb   0
		fcb $3D	; =
		fcb   0
		fcb $7D	; }
		fcb   0
		fcb  $B
		fcb   0
		fcb $1B
		fcb   0
		fcb $17
		fcb   0
		fcb $37	; 7
		fcb   3
