TABLE_LUT_2D
; table	format is:
;    0 - min value
;    1 - max value
;    2 - multiplier
;    3 - table start address
;    n - table end address

; First, test against min and max values
; then scale value to perform look up

; =============== S U B	R O U T	I N E =======================================


TABLE_LU_2D:				; ...
		suba	0,x		; first	cell = (A - min	value)
		bcc	testForMax	; max value = last cell

limitToMin:
		clra

testForMax:				; ...
		cmpa	1,x		; max value = last cell
		bls	loc_F430	; less than value then OK

limitToMax:				; otherwise A =	max.
		ldaa	1,x

loc_F430:				; ...
		ldab	2,x		; B = scaler value
		mul			; A = index, B=mantissa
; End of function TABLE_LU_2D

; TABLE_LU_2Da
; perform 2D table look	up
; Enter	here with scaled value AB = x.x

; =============== S U B	R O U T	I N E =======================================


TABLE_LU_2Da:				; ...
		psha			; save the integer/index value to the stack
		tba			; copy the mantissa to A
		pulb			; copy the index/integer value to B
		abx			; add B	to table address
		tab			; copy mantissa	to B
		beq	loc_F444	; if the mantissa is 0,	skip the interpolation
		ldab	4,x		; else get X2
		subb	3,x		; B = (X2 - X1)
		bcc	loc_F443	; bra if +ve
		negb			; else do a 2's comp
		nega
		inx			; and move up a	cell

loc_F443:				; ...
		mul			; D = mantissa * (X2-X1)

loc_F444:				; ...
		adda	3,x		; and add to the initial value
		rts
; End of function TABLE_LU_2Da

; TAB_LU_3D
; table	lookup return
; call this with
; X-axis value in word_18C
; ? in byte_18E
; no of	columns	in byte_18F
; A?
; column count in B (indexed from 0)

; =============== S U B	R O U T	I N E =======================================


TAB_LU_3D:				; ...
		stab	byte_18F	; store	max. no	of columns
		mul			; row index * columns
		abx			; add row offset to X
		pshx			; stack-1
		ldd	word_18C	; copy column value to D
		jsr	TABLE_LU_2Da	; table	look up	without	scaling
		pulx
		tst	byte_18E
		beq	locret_F486
		std	word_190
		ldab	byte_18F	; maximum no of	columns
		abx
		ldd	word_18C	; VE_18C is the	value from the VE table
		jsr	TABLE_LU_2Da
		subd	word_190
		beq	loc_F483
		bcs	loc_F475
		ldx	#$18E
		jsr	Mult?
		bra	loc_F483
; ---------------------------------------------------------------------------

loc_F475:				; ...
		ldx	#$18E
		coma
		negb
		sbca	#$FF
		jsr	Mult?
		coma
		negb
		sbca	#$FF

loc_F483:				; ...
		addd	word_190

locret_F486:				; ...
		rts
; End of function TAB_LU_3D


; =============== S U B	R O U T	I N E =======================================


TABLE_LU_16bit:				; ...
		suba	0,x		; 16-bit Table Look Up with min	and max?
		bcc	loc_F48C
		clra

loc_F48C:				; ...
		cmpa	1,x
		bls	loc_F492
		ldaa	1,x

loc_F492:				; ...
		ldab	2,x
		mul
; End of function TABLE_LU_16bit

Table_LU_F495:
16-bit table LU, adds an addr offset of	3 for tables
with no	header

; =============== S U B	R O U T	I N E =======================================


Table_LU_F495:				; ...
		asla
		psha
		tba
		pulb
		abx
		clrb
		staa	word_18C	; VE_18C is the	value from the VE table
		beq	loc_F4C0
		ldd	5,x
		subd	3,x
		beq	loc_F4C0
		pshx
		bcs	loc_F4B1
		ldx	#396
		jsr	Mult?
		bra	loc_F4BF
; ---------------------------------------------------------------------------

loc_F4B1:				; ...
		coma
		negb
		sbca	#$FF
		ldx	#$18C		; ptr to VE_18C
		jsr	Mult?
		coma
		negb
		sbca	#$FF

loc_F4BF:				; ...
		pulx

loc_F4C0:				; ...
		addd	3,x
		rts
; End of function Table_LU_F495


; =============== S U B	R O U T	I N E =======================================


Mult?:					; ...
		psha
		ldaa	0,x
		mul
		pulb
		psha
		ldaa	0,x
		mul
		tsx
		addb	0,x
		adca	#0		; add carry to high byte
		ins
		rts
; End of function Mult?

MULT_16x16
16 x 16	multiplication - X * (AB)
uses the stack as temporary RAM
returns	a 16-bit result	in D
- assume this is a fractional multiplication

; =============== S U B	R O U T	I N E =======================================


MULT_16x16:				; ...
		pshx			; SP = High Byte 1, Xptr = 5
					; SP-1 = Low Byte 1, Xptr =4
		pshx			; SP-2 = High Byte 1, Xptr =3
					; SP-3 = Low Byte 1, Xptr =2
		pshb			; SP-4 = low byte 2, Xptr =1
		psha			; SP-5 high byte 2, Xptr =0
		tsx			; Xptr = SP-5 =	0
;
		ldaa	3,x		; a = high byte	1
		mul			; low byte 2 * high byte 1
		staa	5,x		; save result at SP
;
		ldaa	0,x		; a = high byte	2
		ldab	2,x		; b = low byte 1
		mul
		tsta
		bne	loc_F4F9	; bra if result	!= 0
		stab	4,x		; 4,x =	??
;
		ldaa	0,x		; a = high byte	2
		ldab	3,x		; b = low byte 1
		mul			; a*b
		addd	4,x		; add result 1
		bcs	loc_F4F9	; bra if overflow
		std	4,x		; 4,x =	result 2
;
		ldd	1,x		; a = low byte 2, b = low byte 1
		mul			; multiply
		addd	4,x		; D = result
		bcc	loc_F4FC	; bra if no overflow

loc_F4F9:				; ...
		ldd	#$FFFF		; else set D to	maximum	vlaue

loc_F4FC:				; ...
		pulx			; restore stack	pointer
		pulx
		pulx
		rts
; End of function MULT_16x16

TABLE_LU_1x2
this is	a two cell table look up

; =============== S U B	R O U T	I N E =======================================


TABLE_LU_1x2:				; ...
		cmpa	0,x
		bls	loc_F506
		ldaa	0,x

loc_F506:				; ...
		cmpa	1,x
		bcc	locret_F50C
		ldaa	1,x

locret_F50C:				; ...
		rts
; End of function TABLE_LU_1x2

; INJ_TIMING:
; Come here with INJ_PW	in D
; Schedule injector pulse
; OC2 is set to	1 at end of injector pulse so it must be driven	to 0 at	the start

; =============== S U B	R O U T	I N E =======================================


INJ_TIMING:				; ...
		sei			; disable interrupts
		pshb			; INJ_PW to stack
		psha
		tsx			; X=D=INJ_PW
		brset	STATUS_27 $20 loc_F53E ; ' ' ; bra if rpm<500 (not running)
		ldaa	PORTA		; A=PORTA
		bita	#$40 ; '@'      ; test injector port pin
		bne	loc_F53E	; test output?
		ldd	TOC2H		; get OC register
		addd	0,x		; add INJ_PW
		std	TOC2H		; copy to OC register
		subd	TCNT1H		; subtract timer value
		bmi	loc_F537
		cpd	0,x
		bcc	loc_F537
		ldd	TCNT1H		; TCNT1H Timer Counter Register	1 H
		subd	#$1F4
		std	TOC2H		; TOC2H	Output Compare 2 Register H

loc_F537:				; ...
		ldaa	PORTA		; A=PORTA
		bita	#$40 ; '@'      ; test injector port pin
		beq	loc_F568	; bra if INJ output is 0

loc_F53E:				; ...
		ldaa	TCTL1		; TCTL1	Timer Control Register 1
		anda	#$BF ; ''
		staa	TCTL1		; TCTL1	Timer Control Register 1
		ldaa	#$40 ; '@'
		staa	CFORC		; force	INJ OC2	to preset value
		ldd	TCNT1H		; get the last CPS_COUNT
		std	TOC2H		; store	in the OC2 register
		ldd	INJ_DWELL	; get inj_dwell
		addd	0,x		; and add inj_pw
		bcc	loc_F55A	; if no	overflow bra
		ldd	#$FFF0		; else D=FFF0h

loc_F55A:				; ...
		addd	TOC2H		; add the CPS_COUNT
		std	TOC2H		; and set up the next OC2 interrupt
		ldaa	TCTL1		; TCTL1	Timer Control Register 1
		oraa	#$C0 ; ''
		staa	TCTL1		; set injector pin to 1	on next	match

loc_F568:				; ...
		ldaa	#$40 ; '@'
		staa	TFLG1		; enable interrupt on OC2 match
		pulx			; X=INJ_PW (restore SP?)
		rts
; End of function INJ_TIMING

; RTI_HDLR:
; Called every 4.096ms from RTI	interrupt
; read ADC every 1ms
; ADC is left justified	so returns a 16-bit number
; set a	system timer tick every	4ms

; =============== S U B	R O U T	I N E =======================================


RTI_HDLR:				; ...
		ldaa	CNT_4ms
; End of function RTI_HDLR

		inca
		staa	CNT_4ms		; count	to 4ms
		bita	#3		; test for 4ms tick
		bne	do_ADC
		bset	STATUS_26 $20 ;	' ' ; set every 4.096ms

do_ADC:					; ...
		anda	#7
		cmpa	#1
		bne	loc_F5A9
		ldd	ADR2H		; ADR2H	A_D Result Register 2 H
		std	TPSV
		ldd	ADR3H		; ADR3H	A_D Result Register 3 H
		std	O2S_RAW
		ldd	ADR4H		; ADR4H	A_D Result Register 4 H
		std	BATT_RAW
		ldd	ADR5H		; ADR5H	A_D Result Register 5 H
		std	WTS_RAW
		ldd	ADR6H		; ADR6 A_D Result Register 6 H
		std	IAT_RAW
		ldd	ADR7H		; ADR7H	A_D Result Register 7 H
		std	FUEL_RAW	;  Fuel	Level -	not populated
		ldd	ADR8H		; ADR8H	A_D Result Register 8 H
		std	CONFIG_4B	; Config
		ldd	ADR1H		; MAP_RAW
		bra	loc_F5AC
; ---------------------------------------------------------------------------

loc_F5A9:				; ...
		ldd	ADR8H		; ADR8H	A_D Result Register 8 H

loc_F5AC:				; ...
		std	MAP_RAW
		clra
		ldab	CNT_4ms
		bitb	#7		; reset	ADC every 8ms?
		bne	loc_F5B7
		ldaa	#$50 ; 'P'

loc_F5B7:				; ...
		staa	ADCTL		; ADCTL	A_D Control Register

