test_MAP_SENSOR:			; ...
		ldd	MAP_RAW
		std	MAP_16b_4D	; 16-bit MAP value
		cpd	#$2666		; lower	diag limit = 750mV/56mB
		bcs	loc_F5DE	; bra if MAP<minimum
		cpd	#$E666		; upper	diag limit = 4.5V/1300mB
		bcs	loc_F5F2	; bra if MAP<maximum
		ldab	SCI_CNT_1A2	; set codes if error for > CNT_1A2 ticks
		bne	loc_F5DC	; bra if not timeout
		bset	FCodes1	2	; Current Fault	Code 32	- MAP LOW
		ldab	Count_13D
		cmpb	#7
		bcs	loc_F5DC
		bset	FCodes3	2	; Stored Fault Code 32 - MAP LOW

loc_F5DC:				; ...
		bra	loc_F65A	; copied from MAP_RAW above
; ---------------------------------------------------------------------------

loc_F5DE:				; ...
		ldab	SCI_CNT_1A2	; serial port timeout each tick	= 64.5ms
		bne	loc_F65A	; copied from MAP_RAW above
		bset	FCodes1	1	; set Code 31 MAP High
		ldab	Count_13D
		cmpb	#7
		bcs	loc_F65A	; copied from MAP_RAW above
		bset	FCodes3	1	; set Code 31 MAP High
		bra	loc_F65A	; copied from MAP_RAW above
; ---------------------------------------------------------------------------

loc_F5F2:				; ...
		clr	Count_13D
		brclr	STATUS_38 $10 loc_F5FC
		jmp	noMAPCodes
; ---------------------------------------------------------------------------

loc_F5FC:				; ...
		brclr	STATUS_27 $20 loc_F61A ; ' ' ; bra if rpm<500 (not running)
		brset	PORTG_SH_H $80 loc_F614	; '' ; 0 = starter engaged

testMAPatCrank:
		brset	Status_2A 4 loc_F614
		bset	Status_2A 4
		ldaa	MAP_16b_4D	; MAP16b = x*(5/65536) = (0.0253x -199.93)
		cmpa	MAP_400mB	; MAP_RAW_SH1 -	400mB
		bcc	noMAPCodes	; if map is >400mB during cranking - don't set a fault
		bra	loc_F64F
; ---------------------------------------------------------------------------

loc_F614:				; ...
		brclr	FCodes1	1 noMAPCodes ; bra if MAP High not set
		bra	loc_F65A	; copied from MAP_RAW above
; ---------------------------------------------------------------------------

loc_F61A:				; ...
		brset	STATUS_27 $40 loc_F62C ; '@'
		ldx	RPMdiv50	; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		cpx	#$1400		; = 1000RPM
		bcs	loc_F62C
		ldx	TPSA
		cpx	#$3D70		;  = 30degs
		bcs	loc_F632

loc_F62C:				; ...
		brset	FCodes1	1 loc_F65A ; bra if MAP	High set
		bra	noMAPCodes
; ---------------------------------------------------------------------------

loc_F632:				; ...
		subd	MAP_16b_4F	; default to 1012mB
		bcc	loc_F63A
		coma
		negb
		sbca	#$FF

loc_F63A:				; ...
		cpd	word_C7D5	; =80h
		bcc	noMAPCodes
		ldaa	Count_13D+1
		inca
		beq	loc_F64F
		staa	Count_13D+1
		brset	FCodes1	1 loc_F65A ; bra if MAP	High set
		bra	loc_F682
; ---------------------------------------------------------------------------

loc_F64F:				; ...
		ldab	SCI_CNT_1A2	; serial port timeout each tick	= 64.5ms
		bne	loc_F65A	; copied from MAP_RAW above
		bset	FCodes1	1	; set MAPH fault code (current)
		bset	FCodes3	1	; set MAPH fault code (history)

loc_F65A:				; ...
		ldd	MAP_16b_4D	; copied from MAP_RAW above
		std	MAP_16b_4F	; default to 1012mB
		ldd	#$9999
		brclr	STATUS_27 $10 MAP_defaults ; bra if idle switch	OFF
		ldaa	WTS_LIN
		cmpa	#$30 ; '0'      ; -10C - WTS_LIN
		bcs	loc_F670	; bra if WTS>-10C
		ldd	#$6666		; =26214
		bra	MAP_defaults
; ---------------------------------------------------------------------------

loc_F670:				; ...
		ldd	#$7AE1		; =31457

MAP_defaults:				; ...
		std	MAP_16b_4D	; default value	if MAP fault
		std	MAP_51		; default value	if MAP fault
		std	MAP_53		; default value	if MAP fault
		std	MAP_16b_55	; default value	if MAP fault
		rts
; ---------------------------------------------------------------------------

noMAPCodes:				; ...
		clr	Count_13D+1
		bclr	FCodes1	3	; clear	MAP codes

loc_F682:				; ...
		ldd	MAP_16b_4D	; MAP16b = x*(5/65536) = (0.0253x -199.93)
		std	MAP_16b_4F	; default to 1012mB
		brclr	STATUS_27 $20 loc_F69C ; ' ' ; bra if rpm>500 (engine running)
		brset	Status_2A 2 loc_F69C
		brset	PORTG_SH_H $80 loc_F69C	; '' ; 0 = starter engaged
		bset	Status_2A 2	; set status bit
		pshb			; push MAP_16
		psha
		jsr	CALC_BARO_2

code_F69A:				; Pull MAP_16
		pula
		pulb

loc_F69C:				; ...
		cpd	MAP_51
		bls	loc_F6A3
		std	MAP_51

loc_F6A3:				; ...
		cpd	MAP_53		; init to FFFFh
		bhi	locret_F6AA
		std	MAP_53		; init to FFFFh

locret_F6AA:				; ...
		rts
; End of function test_MAP_SENSOR


