do_TPS_TICK:				; ...
		ldd	TPSV
		cmpa	#5		; TPS minimum voltage
		bcs	loc_F6C9
		cmpa	#$F5 ; ''      ; TPS maximum voltage
		bcs	skipTPSfaults
		ldab	SCI_CNT_1A2	; serial port timeout each tick	= 64.5ms
		bne	loc_F6DB
		bset	FCodes0	8	; set Code 21 TPS High
		ldab	TPSFaultCounter
		cmpb	#$19		; 200ms
		bcs	loc_F6DB
		bset	FCodes2	8	; set Code 21 TPS High
		bra	loc_F6DB
; ---------------------------------------------------------------------------

loc_F6C9:				; ...
		ldab	SCI_CNT_1A2	; serial port timeout each tick	= 64.5ms
		bne	loc_F6DB
		bset	FCodes0	$10	; set Code 22 TPS Low
		ldab	TPSFaultCounter
		cmpb	#$19
		bcs	loc_F6DB
		bset	FCodes2	$10	; set Code 22 TPS Low

loc_F6DB:				; ...
		ldd	#$3333
		bra	loc_F6E6
; ---------------------------------------------------------------------------

skipTPSfaults:				; ...
		clr	TPSFaultCounter
		bclr	FCodes0	$18	; clear	TPS codes 21,22

loc_F6E6:				; ...
		std	TPSV_8_2ms	; current TPS voltage
		subd	byte_16
		bcc	loc_F6EE
		clra
		clrb

loc_F6EE:				; ...
		ldx	TPSA
		std	TPSA
		ldd	TPSA_T1
		stx	TPSA_T1
		std	TPSA_T2
		ldd	TPSA
		subd	TPSA_T2
		bcc	loc_F705
		bmi	loc_F70A
		ldd	#$8000
		bra	loc_F70A
; ---------------------------------------------------------------------------

loc_F705:				; ...
		bpl	loc_F70A
		ldd	#$7FFF

loc_F70A:				; ...
		std	dTPS_87		; related to dTPS?

; code_F70C:
; ISC_Curr_Pos += (ISC_Curr_Pos	- TPS position)/4
; this could be	the I term for the control loop	????

code_F70C:				; updated on an	8.2ms tick
		ldd	TPSV_8_2ms
		subd	ISC_Target_Pos
		rora
		rorb
		asra
		rorb
		addd	ISC_Target_Pos
		std	ISC_Target_Pos	; ISC_Curr_Pos + x
		rts
; End of function do_TPS_TICK


