; do_CPS_EVENT:
; Called every 4 RTI ticks and from within
; most other ticks (if longer than 4 RTI ticks??)
; executes if there has	been a CPS event

; =============== S U B	R O U T	I N E =======================================


do_CPS_EVENT:				; ...
		brclr	STATUS_26 $80 locret_F86F ; '' ; return if no CPS event
		bclr	STATUS_26 $80 ;	'' ; clear CPS event flag
		jsr	CALC_RPM
		jsr	update_MAP_Params
		ldaa	#$3E ; '>'
		staa	CPS_FLT_TMR	; reset	CPS fault timer
		jsr	do_IFS
		ldab	#5
		ldaa	RPMdiv50	; RPMdiv50 is a	byte, as a double it is	RPM/5.12
		cmpa	#$A		; RPM-50
		bcs	RPMunder500	; bra if RPM<500

RPMover500:				; bra if RPM<500 already clear
		brclr	STATUS_27 $20 loc_F818 ; ' '
		bclr	STATUS_27 $20 ;	' ' ; else set RPM>500 (engine running)
		bset	Status_2A 4	; set starter engaged?
		clr	Count_13D+1	; clear	byte_13E

loc_F818:				; ...
		brset	STATUS_38 $40 RPMunder500 ; '@' ;  decrement count_ed
		ldaa	PORTH		; PORTH	I_O Port H
		oraa	#$20 ; ' '
		staa	PORTH		;  PH, 5
		ldab	COUNT_ED	; update counter
		beq	loc_F82B
		decb

RPMunder500:				; ...
		stab	COUNT_ED	;  decrement count_ed

loc_F82B:				; ...
		jsr	do_PORTH_bit5?
		jsr	CALC_BASE_IGN
		jsr	CALC_IGN_IDLE_CORR
		jsr	CALC_ELOAD_KICK1?
		jsr	do_IGN_WTS_HI_CORR
		jsr	CALC_IGN_DWELL
		jsr	SUM_IGN_ADV
		jsr	calc_dCPS	; multiple bytes Cx
		jsr	do_TIME_TO_DWELL ; related to ign_dwell
		jsr	SCHEDULE_IGN
		jsr	do_IGN_v_WTS_IGN8
		jsr	CALC_IGN_IAT_CORR_0
		jsr	CALC_PSP_KICK
		brclr	STATUS_27 $20 do_INJ_Stuff ; ' ' ; bra if rpm>500 (engine running)


		brset	STATUS_27 4 locret_F86F	; fuel cut due to IFS time out
		jsr	INJ_CALCS_0_0	; do the injector calcs
		jsr	WTS_FLT_CLR_A4_AD
		clr	WTS_CORR_B8
		ldd	MAP_16b_55	; changes when MAP changes - default is	9999h =	39321
		std	MAP_65
		std	MAP_67
		ldd	TPSA
		std	TPSA_78
		std	TPSA_7A

locret_F86F:				; ...
		rts
; ---------------------------------------------------------------------------

do_INJ_Stuff:				; ...
		jsr	CALC_BYTE_B5
		jsr	CALC_EGR_B6
		jsr	CALC_A8_65_67
		jsr	CALC_AA_78_7A
		jsr	Calc_INJ_DWELL
		jsr	set_WTS_CORR_B8_B
		jsr	calc_FUEL_0
		tst	COUNT_15D
		beq	loc_F88F	; bra if TPS<60	and fuel cut
		dec	COUNT_15D
		bra	loc_F8A4
; ---------------------------------------------------------------------------

loc_F88F:				; ...
		brclr	STATUS_27 $46 loc_F895 ; 'F' ; bra if TPS<60 and fuel cut
		bra	loc_F8A4
; ---------------------------------------------------------------------------

loc_F895:				; ...
