VSS_INT_HANDLER:
Called each time there is a VSS	event.
VSS_COUNT is incremented each time and reset
in calc_VSS (a 1.048s timer loop)

; =============== S U B	R O U T	I N E =======================================


		; public VSS_INT_HNDLR
VSS_INT_HNDLR:				; ...
		ldaa	PORTA		; A=PORTA
		bita	#2
		bne	loc_F9C7
		ldaa	IGN_Cnt_F5
		cmpa	#2
		bcc	loc_F9BF
		ldaa	TIC2H		; get Timer 1 IC2
		tab			; copy to B
		suba	VSS_PERIOD	; T1IC2	- VSS count
		cmpa	#6
		bcs	loc_F9C7

loc_F9BF:				; ...
		stab	VSS_PERIOD
		inc	VSS_COUNT	; increment VSS	COUNT on each tick
		clr	IGN_Cnt_F5

loc_F9C7:				; ...
		ldaa	#2
		staa	TFLG1		; TFLG1	Main Timer Interrupt Flag Register 1
		rti
; End of function VSS_INT_HNDLR

CPS_INT_HNDLR:
Camshaft Position Sensor interrupt Handler
CPS signal is not inverted.
There is a delay on the	positive going edge (input tom uC pin)
There is no delay on the falling edge

; =============== S U B	R O U T	I N E =======================================


		; public CPS_INT_HNDLR
CPS_INT_HNDLR:				; ...
		ldaa	TCTL2		; TCTL2	Timer Control Register 2
		ldx	TO5I4H		; get the input	capture	value
		ldab	PORTA		; B=PORTA
		bita	#$40 ; '@'      ; test TCTL2
		beq	R_EDGE		; bra if RE
come here if falling edge
		bitb	#8		; test CPS pin
		beq	exit_FA25	; bra if high (missed a	pulse/filter?)
caome here if falling edge and CPS is low
		oraa	#$80 ; ''      ; EDGB = 1
		anda	#$BF ; ''      ; EDGA = 0
		staa	TCTL2		; trigger CPS on falling edge
		stx	CPS_TIME	; save the time
		bset	STATUS_26 1
		ldab	COUNT_ED
		bne	loc_F9F8	; if count_ED !=0 dec byte_EA
		ldab	IGN_CNT_EA
		beq	go_do_IGN	; bra if COUNT_EA=0
		decb
		stab	IGN_CNT_EA

go_do_IGN:				; ...
		jsr	do_IGN

loc_F9F8:				; ...
		ldx	#$C0 ; ''      ; CPS_COUNT2
		jsr	CALC_CPS_COUNT
		ldaa	COUNT_ED
		beq	exit_FA25	; clear	IF and return
		ldab	#1
		stab	IGN_CNT_EA
		ldx	CPS_TIME
		stx	TOC1H		; TOC1H	Output Compare 1 Register H
		ldaa	OC1D		; get OC edge setting
		anda	#$7F ; ''
		staa	OC1D		; 0 = coil on next OC match
		ldaa	#$80 ; ''
		staa	CFORC		; force	ign on
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		anda	#$7F ; ''
		staa	TMSK1		; disable ign interrupt?
		ldaa	#$80 ; ''
		staa	TFLG1		; TFLG1	Main Timer Interrupt Flag Register 1

exit_FA25:				; ...
		ldaa	#8
		staa	TFLG1		; clear	CPS IF and return
		rti
; ---------------------------------------------------------------------------

R_EDGE:					; ...
		bitb	#8		; test PORTA
		beq	loc_FA32	; bra if COPS high
		jmp	exit_FA97
; ---------------------------------------------------------------------------

loc_FA32:				; ...
		oraa	#$40 ; '@'
		anda	#$7F ; ''
		staa	TCTL2		; trigger CPS on rising	edge
		stx	CPS_TIME
		bclr	STATUS_26 1
		ldab	COUNT_ED
		bne	loc_FA4C
		ldab	IGN_CNT_EA
		beq	loc_FA49
		decb
		stab	IGN_CNT_EA

loc_FA49:				; ...
		jsr	do_IGN

loc_FA4C:				; ...
		ldx	#$91 ; ''      ; pointer to CPS_COUNT
		jsr	CALC_CPS_COUNT
		std	CPS_CNT_div256	; CPS_COUNT3 = 0:CPS_COUNT
		ldd	CPS_COUNT	; =240degs/2us
		lsrd
		addd	CPS_COUNT	; D=CPS_COUNT*1.5
		rora
		rorb			; D=CPS_COUNT*0.75
		lsrd
		std	CPS_CNT_DIV_2p667
		ldd	CPS_COUNT	; =240degs/2us
		lsrd
		lsrd
		lsrd
		lsrd
		std	CPS_CNT_div16
		ldaa	COUNT_ED
		beq	loc_FA8D
		ldab	#2
		stab	IGN_CNT_EA
		ldx	CPS_TIME
		stx	TOC1H		; TOC1H	Output Compare 1 Register H
		ldaa	OC1D		; get OC edge setting
		oraa	#$80 ; ''
		staa	OC1D		; 1 = coil off next OC match
		ldaa	#$80 ; ''
		staa	CFORC		; force	coil off
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		anda	#$7F ; ''
		staa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		ldaa	#$80 ; ''
		staa	TFLG1		; TFLG1	Main Timer Interrupt Flag Register 1

loc_FA8D:				; ...
		clra
		staa	IGN_CNT_9B
		bset	STATUS_26 $80 ;	'' ; new CPS_COUNT?
		ldx	CPS_TIME
		stx	CPS_COUNT_T1

exit_FA97:				; ...
		ldaa	#8
		staa	TFLG1		; clear	CPS IF and return
		rti
; End of function CPS_INT_HNDLR


