INJ_INT_HNDLR:				; ...
		brclr	STATUS_27 $20 disable_INJ_INT ;	' ' ; bra if rpm<500 (not running)
		brclr	STATUS_26 $40 INJ_PW2_FADA ; '@' ; bra if no second shot
		bclr	STATUS_26 $40 ;	'@' ; clear second shot
		tst	INJ_PW2		; test second shot pw
		beq	disable_INJ_INT	; if its zero bra
		ldaa	byte_C7DE	; =Ah => 2560
		clrb			; D=2560
		addd	TOC2H		; TOC2H	Output Compare 2 Register H
		std	TOC2H		; schedule interrupt in	2560*2us
		ldaa	#$40 ; '@'
		staa	TFLG1		; clear	OC2 interrupt flag
		rti
; ---------------------------------------------------------------------------

disable_INJ_INT:			; ...
		bclr	STATUS_26 $40 ;	'@' ; no second shot
		ldaa	TMSK1		; TMSK1	Main Timer Interrupt Mask Register 1
		anda	#$BF ; ''
		staa	TMSK1		; disable OC2 interrupt
		ldaa	#$40 ; '@'
		staa	TFLG1		; clear	OC2 interrupt flag
		rti
; ---------------------------------------------------------------------------

INJ_PW2_FADA:				; ...
		ldaa	INJ_PW2		; A =  second shot PW
		clr	INJ_PW2		; clear	second shot PW
		cmpa	byte_C7DD	; 3072-INJ_PW2
		bcs	loc_FAEC	; bra if INJ_PW2>3072
		suba	byte_C7DD	; else INJ_PW2-3072
		staa	INJ_PW2		; second shot is remainder
		ldaa	byte_C7DD	; PW_LIM limits	the inj_pw to n	in two shot mode (0Xword)

loc_FAEC:				; ...
		clrb			; D=n:0
		bset	STATUS_26 $40 ;	'@' ; set inj_pulse pending?
		jsr	INJ_TIMING	; schedule the pulse
		rti
; End of function INJ_INT_HNDLR


; =============== S U B	R O U T	I N E =======================================


		; public ISC_INT_HNDLR
ISC_INT_HNDLR:				; ...
		ldaa	TCTL3		; TCTL3	Timer Control Register 3
		bita	#1		; is OC7 set to	toggle?
		bne	OC7_went_1	; bra if it is
		ldd	ISC_OC_PW
		beq	loc_FB16	; bra if F9 is zero
		ldd	TCNT2H		; get OC7 count
		addd	#$64 ; 'd'      ; add (100*4us)
		std	TO7I6H		; set up next compare
		ldaa	TCTL3		; TCTL3	Timer Control Register 3
		oraa	#3
		staa	TCTL3		; set OC7 to 1 on match
		ldaa	#2
		staa	TFLG2		; clear	interrupt flag
		rti
; ---------------------------------------------------------------------------

loc_FB16:				; ...
		bclr	STATUS_26 $10
		ldaa	TMSK2		; TMSK2	Misc. Timer Interrupt Mask Register 2
		anda	#$FD ; ''
		staa	TMSK2		; disable OC7 interrupt
		ldaa	#2
		staa	TFLG2		; clear	interrupt flag
		rti
; ---------------------------------------------------------------------------

OC7_went_1:				; ...
		ldd	ISC_OC_PW
		cpd	#$61A		; byte_F9 - 1562
		bcs	loc_FB4B	; bra if byte_F9 < 1562
		subd	#$61A		; else subtract	1562 (zero count?)
		std	ISC_OC_PW	; reset	count?
		ldd	TO7I6H		; get last OC7 count
		addd	#$186A		; add 6250 =(25ms)
		std	TO7I6H		; set next compare
		ldaa	TCTL3		; TCTL3	Timer Control Register 3
		anda	#$FE ; ''
		staa	TCTL3		; clear	OC7 on next match
		ldaa	#2
		staa	TFLG2		; clear	interrupt flag
		rti
; ---------------------------------------------------------------------------

loc_FB4B:				; ...
		lsld
		lsld			; =byte_F9*4
		cpd	#$64 ; 'd'      ; D-100
		bcc	loc_FB56	; bra if D>100
		ldd	#$64 ; 'd'      ; else minimum is 100

loc_FB56:				; ...
		addd	TCNT2H		; add to current timer value?
		std	TO7I6H		; set up next match
		ldaa	TCTL3		; TCTL3	Timer Control Register 3
		anda	#$FE ; ''
		staa	TCTL3		; clear	OC7 on next match
		ldaa	#2
		staa	TFLG2		; clear	interrupt flag
		clra
		clrb
		std	ISC_OC_PW	; reset	byte_F9	to zero
		rti
; End of function ISC_INT_HNDLR


