Main timer @ E clock
RTI enabled, TOI Off, PA off
		ldaa	#$40 ; '@'
		staa	TMSK2		; TMSK2	Misc. Timer Interrupt Mask Register 2
		ldaa	#$50 ; 'P'
		staa	SPCR		; SPCR SPI Control Register
		ldaa	PORTD		; PORTD	I_O Port D
		anda	#$DF ; ''
		staa	PORTD		; PORTD	I_O Port D
		ldaa	SPSR		; SPSR SPI Status Register
		ldaa	#$F
		staa	SPDAT		; SPDAT	SPI Data Register
		staa	SR_DATAOUT	; init output shift register
PWCLK:
Prescaler A = A/8 = 250kHz
Prescaler B = E/128 = 15625Hz
		ldaa	#$37 ; '7'
		staa	PWCLK		; PWCLK	PWM Timer Clock	Select
PWPOL:
PWM1,2,3 use clock S
PWM4 uses clock	B
		ldaa	#$74 ; 't'
		staa	PWPOL		; PWPOL	PWM Timer Polarity
PWSCAL:
Clock S	= clock	A/49 = 5.1kHz
		ldaa	#$31 ; '1'
		staa	PWSCAL		; PWSCAL PWM Timer Prescaler
		ldaa	#$A0 ; ''
PWPER3:
PWM3 period = 1/(S/160)	= 31.4ms
		staa	PWPER3		; PWPER3 PWM Timer Period 3
BAUD:
Baud rate = 7812?
		ldaa	#4
		staa	BAUD		; BAUD SCI Baud	Rate Control
PORTD:
/SS is an output
		ldaa	PORTD		; PORTD	I_O Port D
		oraa	#$20 ; ' '
		staa	PORTD		; PORTD	I_O Port D
SCCR1,2:
SCCR1: 8n1, WU on idle
SCCR2: RIE, Rx en, RWU en

		ldaa	#0
		staa	SCCR1		; SCCR1	SCI Control Register 1
		ldaa	#$26 ; '&'
		staa	SCCR2		; SCCR2	SCI Control Register 2
ADCTL:
Convert	8 channels
		ldaa	#$50 ; 'P'
		staa	ADCTL		; ADCTL	A_D Control Register
test_buf4:
Initialise bytes 4 to 14h?

test_Buff_4:
		ldx	#4

loc_FC49:				; ...
		ldaa	0,x
		cmpa	byte_D0F7	; =CCh
		bhi	InitVarsAsS8	; init signed memory addresses
		cmpa	byte_D0F8	; =33h
		bcs	InitVarsAsS8	; init signed memory addresses
		inx
		cpx	#$14
		bne	loc_FC49
		clra
		clrb
		ldx	#4

loc_FC60:				; ...
		addb	0,x
		adca	#0		; add carry to high byte
		inx
		cpx	#$14
		bne	loc_FC60
		subd	new_LTFT_14
		bne	InitVarsAsS8	; init signed memory addresses
		clra
		clrb
		ldx	#$16

loc_FC73:				; ...
		addd	0,x
		inx
		inx
		cpx	#$1C
		bls	loc_FC73
		coma
		comb
		subd	byte_1E
		beq	loc_FCC6

InitVarsAsS8:				; ...
		ldd	#$8080		; init signed memory addresses
		ldx	#4

loc_FC88:				; ...
		std	0,x
		inx
		inx
		cpx	#$14
		bcs	loc_FC88
		ldd	#$800
		std	new_LTFT_14

clearFCodes:
		clra
		clrb
		std	FCodes3		; init fcodes3,2 to zero
		std	FCodes1		; init fcodes1,0 to zero

test_Auto_Config:			; A=PORTA
		ldaa	PORTA
		bita	#4		; test Auto/MT switch
		bne	Config_Is_Manual

Config_is_Auto:				; init value for  byte_16 AT
		ldx	byte_C8C3
		stx	byte_16		; byte_16=1F00h
		ldx	byte_C8C5	; =20C4h
		stx	DEF_ISC_POS_18?	; byte_18 = 2000h
		bra	Config_is_any	; =2161h
; ---------------------------------------------------------------------------

Config_Is_Manual:			; ...
		ldx	byte_C8BF	; =1E1Bh
		stx	byte_16		; byte_16=1E1Bh
		ldx	byte_C8C1	; =2080h
		stx	DEF_ISC_POS_18?	; byte_18 = 2080h

Config_is_any:				; ...
		ldx	byte_C8C7	; =2161h
		stx	byte_1A
		ldx	byte_C8C9	; =2260h
		stx	byte_1C
		jsr	calc_1E

loc_FCC6:				; ...
		ldaa	PORTJ		; PORTJ	I_O Port J
		eora	#1
		staa	PORTJ		; toggle watchdog

code_FCCE:
		clra
		ldx	#$21 ; '!'

loc_FCD2:				; ...
		staa	0,x		; clear	RAM from 21h to	1B6h
		inx
		cpx	#$1B6		; end of clear RAM
		bne	loc_FCD2	; clear	RAM from 21h to	1B6h
		ldaa	PORTG		; PORTG	I_O Port G
		tab
		std	PORTG_SH_H	; double register with 8A
		bclr	FCodes3	4	; clear	Code 41	- IFS
		bclr	FCodes1	$10	; clear	Code 46	- ISC
		bclr	FCodes1	1	; clear	Code 31	MAP high
		ldd	#$BA00
		staa	BARO		; default Baro = 1012mB
		std	MAP_16b_4F	; default to 1012mB
		ldd	#$FFFF
		std	MAP_53		; init to FFFFh
		ldd	byte_16
		std	ISC_Target_Pos	; default ISC pos = 100% ??
		std	word_10D
		ldaa	#$30 ; '0'
		staa	STATUS_27	; default to engine not	running	& closed throttle

